import Login from "./Login";
import io from "socket.io-client";

const socket = io.connect("http://localhost:80");
socket.emit("message", {
  channel_name: 'first channel',
  room_name: 'first room',
  user_name: 'sangchovy',
  content: 'hello',
});

function App() {
  return (
    <Login />
  );
}

export default App;
